import React from 'react';

interface TaskItemProps {
    task: {
        id: string;
        title: string;
        completed: boolean;
    };
}

const TaskItem: React.FC<TaskItemProps> = ({ task }) => {
    return (
        <div>
            <input type="checkbox" checked={task.completed} readOnly />
            <span>{task.title}</span>
        </div>
    );
};

export default TaskItem;
